import React, {useState} from 'react';

var contentsData = [
    {id: 1, title:"First title", date:"2021.09."},
    {id: 2, title:"Second title", date:"2021.09."},
    {id: 3, title:"Third title", date:"2021.09."}
]


function Contents(props) {

    var lists = [];
    var i = 0;

    for (i=0; i < contentsData.length; i++){
      lists.push(
        <div className = "list">
          <h3>{contentsData.title[i]}</h3>
          <p>{contentsData.date[i]}+{10+i}</p>
          <hr/>
        </div>
      )
    }

    return(
      <>
      {lists}
      </>
    );
  }

  export default Contents;
